import React from 'react';
import PropTypes from 'prop-types';
import PubNub from 'pubnub';

class Messages extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            messages: [],
        }
    }

    render() {
        return (
            <div>Hello</div>
        )
    }
}

Messages.PropTypes = {
    client: PropTypes.any.isRequired,
};

export default Messages;
